import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { AuthProvider } from "../context/auth.provider";
import { RouterPerson } from "../../person/module/person.routes";
import { RouterLogin } from "../../login/module/login.routes";
import { ProtectedRoutes } from "./Protected.routes";
import { useContext, useEffect } from "react";
import { AuthContext } from "../context/auth.context";
import { RouterEmployee } from "../../employee/module/employee.routes";
export const RoutesHtml = () => {
  const { context } = useContext(AuthContext);
  useEffect(() => {
    console.log(context);
  }, [context]);
  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/" element={<RouterLogin />} />
          <Route
            path="/module/*"
            element={
              <ProtectedRoutes auth={context}>
                <RouterPerson />
                <RouterEmployee />
              </ProtectedRoutes>
            }
          />
        </Routes>
      </Router>
    </AuthProvider>
  );
};
